export enum TaskStatus {
    Todo = 'Todo',
    InProgress = 'InProgress',
    Completed = 'Completed',
}

export class Task {
    _id: number = 0;
    title: string = '';
    description: string = '';
    dueDate: Date | null = null;
    status: TaskStatus = TaskStatus.Todo;
}
